import { useEffect} from "react";
import AdminNavBar from "./AdminNavBar";
import {useNavigate} from 'react-router-dom'
import { getRoleFromLocalStorage } from "../../utils";

function NavBar(){
    const [role, setRole] = useState(getRoleFromLocalStorage());
    useEffect(()=>{
        const roleFromLocalStorage = getRoleFromLocalStorage();
        setRole(roleFromLocalStorage);
    },[role])
    
    const navigate = useNavigate()
    const handleNavToMain = ()=>{
        navigate('/')
    }
    return(
        <div>
            <button onClick={handleNavToMain}>Main Page</button>
            {role==='ROLE_ADMIN'&&<AdminNavBar></AdminNavBar>}
        </div>
    )

}
export default NavBar;
